import React from "react";
import UserSelection from "../../ui/userSelection/userSelection";
import styles from "./rul.module.css";
const RulLife = () => {
  return (
    <div className={styles.flex}>
      
      <div className={styles.user}>
        <UserSelection />
      </div>
    </div>
  );
};

export default RulLife;
